import React from "react";

import Card from "../components/UiElements/Card";
import UserLocations from "../../locations/pages/UserLocations";
import "./Home.css"

import { STATIC_PLACES} from "../../locations/pages/UserLocations";
import LocationList from "../../locations/components/location-list/LocationList";

const Home = () => {
    return (
        <React.Fragment>
            <Card>
                <h1>News Feed</h1>
                <div>

                    <LocationList item={STATIC_PLACES}/>
                </div>
            </Card>
        </React.Fragment>
    );
} 

export default Home;
